import React from "react";
import {
  StyleSheet,
  Text,
  TextInput,
  Button,
  SafeAreaView,
  ScrollView,
  StatusBar,
} from "react-native";
import { View } from "react-native-web";

import Icon from "react-native-vector-icons/FontAwesome";

let data = [
  ["Bandung", "Lampung", "Jawa", "ambon"],
  ["Bandung", "Lampung", "Surabaya", "ambon"],
  [11, 12, 13, 14, 15],
];

let box = data.map((item) => {
  return (
    <View style={styles.showbox}>
      <View style={styles.showbox1}>
        <Text
          style={{
            fontSize: 18,
            fontWeight: 600,
            marginRight: 30,
          }}
        >
          ss
        </Text>
        <Text
          style={{
            fontSize: 18,
            fontWeight: 600,
            marginRight: 30,
          }}
        >
          -
        </Text>
        <Text
          style={{
            fontSize: 18,
            fontWeight: 600,
            marginRight: 30,
          }}
        >
          ss
        </Text>
      </View>
      <View style={styles.showbox2}>
        <View style={styles.iconshowbox2}>
          <Icon name="plane" size={40} style={{ color: "green" }}></Icon>
          <Text
            style={{
              fontSize: 18,
              fontWeight: 800,
              marginRight: 55,
              marginLeft: 10,
              marginTop: 5,
            }}
          >
            Elang
          </Text>
        </View>
        <Text
          style={{
            fontSize: 18,
            fontWeight: 600,
            marginRight: 50,
            marginTop: 5,
            color: "blue",
          }}
        >
          ss
        </Text>
      </View>
    </View>
  );
});

const HasilScreen = ({ route, navigation }) => {
  return (
    <View style={styles.container}>
      <View style={styles.box}>
        <Icon
          name="arrow-left"
          size={30}
          style={{
            color: "white",
          }}
        />
        <Icon
          name="user"
          size={40}
          style={{
            marginLeft: "auto",
            marginTop: -30,
            color: "white",
          }}
        />
        <Text style={styles.textHeader}>Hiling.id</Text>
        <Text style={styles.textHeader2}>Hasil Pencarian Penerbangan</Text>
        <Text style={styles.textHeader2}>(14 Mei 2022)</Text>
      </View>
      <SafeAreaView style={styles.box2}>
        <ScrollView>
          <box />
        </ScrollView>
      </SafeAreaView>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 0.8,
  },
  box: {
    backgroundColor: "green",
    flex: 1,

    padding: 20,
  },
  textHeader: {
    textAlign: "center",
    color: "white",
    fontSize: 20,
    fontWeight: 600,
    marginBottom: 10,
  },
  textHeader2: {
    textAlign: "center",
    color: "white",
    fontSize: 16,
    fontWeight: 400,
  },
  box2: {
    flex: 3,
  },
  showbox: {
    borderWidth: 1,
    borderRadius: 7,
    padding: 17,
    marginLeft: 20,
    marginRight: 20,
    marginTop: 20,
  },
  showbox1: {
    flexDirection: "row",
    marginBottom: 10,
  },
  showbox2: {
    flexDirection: "row",
  },
  iconshowbox2: {
    flexDirection: "row",
  },
});

export default HasilScreen;
